import React, { useState } from "react";
import { motion } from "framer-motion";

const Dashboard: React.FC = () => {
  const [selected,setSelected] = useState<string>("")
  return (
    <div>
      <div>My Dashboard</div>
      <motion.div
        onClick={()=> setSelected("all")}
      >All</motion.div>
      <motion.div onClick={()=> setSelected("withdrawal")}>Withdrawal</motion.div>
      <motion.div onClick={()=> setSelected("savings")}>Savings</motion.div>
      <motion.div onClick={()=> setSelected("de")}>Deposit</motion.div>
    </div>
  );
};

export default Dashboard;
